import {
  Dvr,
  Apartment,
  MedicalServices,
  School,
  Assessment,
} from "@mui/icons-material";

const pages = [
  {
    id: "digitalization",
    title: "Цифровізація",
    type: "collapse",
    icon: Dvr,

    children: [
      {
        id: "All",
        title: "Загальна",
        type: "item",
        url: "/digitalization",
        target: true,
      },
      {
        id: "CNAP",
        title: "ЦНАП",
        type: "item",
        url: "/pages/login/login3",
        target: true,
      },
      {
        id: "register3",
        title: "Register",
        type: "item",
        url: "/pages/register/register3",
        target: true,
      },
    ],
  },
  {
    id: "infrastructure",
    title: "Інфраструктура",
    type: "collapse",
    icon: Apartment,

    children: [
      {
        id: "All",
        title: "Загальна",
        type: "item",
        url: "/infrastructure",
        target: true,
      },
    ],
  },
  {
    id: "healthcare",
    title: "Охорона здоров'я",
    type: "collapse",
    icon: MedicalServices,

    children: [
      {
        id: "All",
        title: "Загальна",
        type: "item",
        url: "/healthcare",
        target: true,
      },
    ],
  },
  {
    id: "education",
    title: "Освіта",
    type: "collapse",
    icon: School,

    children: [
      {
        id: "All",
        title: "Загальна",
        type: "item",
        url: "/education",
        target: true,
      },
    ],
  },
  {
    id: "economy",
    title: "Економіка",
    type: "collapse",
    icon: Assessment,

    children: [
      {
        id: "All",
        title: "Загальна",
        type: "item",
        url: "/economy",
        target: true,
      },
    ],
  },
];

export default pages;
